    {
        __setProtocolFee(_feeBps);
    }


    function __setFeeWallet(address addr)
        internal 
    {
        FEE_WALLET = addr;
        emit SetFeeWallet(addr);
    }

    /**
     * @dev set the address for taking the protocol fees
